import {ACTION_TYPES} from "../constants";

const initState = {
  productSelection: []
}
export default (state = initState, {type, payload}) => {
  switch (type) {

    case ACTION_TYPES.EXPORT.GET_PRODUCT_SUCCESS:
      return {...state, productSelection: payload}

    default:
      return state;
  }
}
